CREATE TABLE IF NOT EXISTS `customers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `customer_company` varchar(255) DEFAULT NULL,
  `tantou` varchar(255) DEFAULT NULL,
  `phone` int(11) NOT NULL,
  `address` varchar(255) DEFAULT NULL,
  `boss` varchar(255) DEFAULT NULL,
  `category` varchar(255) DEFAULT NULL,
  `subcat` varchar(255) DEFAULT NULL,
  `date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `phone_index` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `delivery` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `track_id` int(11) NOT NULL,
  `product_id` int(11) NOT NULL,
  `no` int(11) NOT NULL,
  `discount` decimal(12,2) DEFAULT NULL,
  `customer_id` int(11) NOT NULL,
  `truck_id` int(11) NOT NULL,
  `deli_date` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `track_id_index` (`track_id`),
  KEY `product_id_index` (`product_id`),
  KEY `no_index` (`no`),
  KEY `customer_id_index` (`customer_id`),
  KEY `truck_id_index` (`truck_id`),
  CONSTRAINT `customer_id` FOREIGN KEY (`customer_id`) REFERENCES `customers` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `product_id` FOREIGN KEY (`product_id`) REFERENCES `products` (`pid`) ON UPDATE CASCADE,
  CONSTRAINT `truck_id` FOREIGN KEY (`truck_id`) REFERENCES `trucks` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=219 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `products` (
  `pid` int(11) NOT NULL AUTO_INCREMENT,
  `id` varchar(45) NOT NULL,
  `product_name` varchar(255) DEFAULT NULL,
  `stock` int(11) NOT NULL,
  `Price` varchar(255) DEFAULT NULL,
  `Weight` varchar(255) DEFAULT NULL,
  `AM03003` varchar(12) DEFAULT NULL,
  `factory` varchar(12) DEFAULT NULL,
  PRIMARY KEY (`pid`),
  KEY `stock_index` (`stock`)
) ENGINE=InnoDB AUTO_INCREMENT=1177 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `taku` (
  `商品番号` varchar(12) NOT NULL,
  `商品名` varchar(45) NOT NULL,
  `在庫` int(11) DEFAULT NULL,
  `注残` int(11) DEFAULT NULL,
  `余数` int(11) DEFAULT NULL,
  `区分` int(11) DEFAULT NULL,
  `AM03003` varchar(12) DEFAULT NULL,
  PRIMARY KEY (`商品番号`),
  KEY `AM03003_index` (`AM03003`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `truck_company` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `truck_company` varchar(25) DEFAULT NULL,
  `no_of_trucks` int(11) NOT NULL,
  `boss` varchar(25) DEFAULT NULL,
  `phone` bigint(20) NOT NULL,
  `address` varchar(25) DEFAULT NULL,
  `date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `no_of_trucks_index` (`no_of_trucks`),
  KEY `phone_index` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `trucks` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `truck_company_id` int(11) NOT NULL,
  `type` varchar(12) DEFAULT NULL,
  `capacity` int(11) NOT NULL,
  `fee` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `truck_company_id_index` (`truck_company_id`),
  KEY `capacity_index` (`capacity`),
  KEY `fee_index` (`fee`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `user_data` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `name` varchar(64) NOT NULL,
  `email` varchar(64) NOT NULL,
  `password` varchar(32) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `users` (
  `email` varchar(255) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;








